import React from "react";

import { Heading, Container, SubHeading } from "./styles";
import { useParams } from "react-router-dom";
import Typist from "react-typist";
const PersonBio = () => {
  const { id }: any = useParams();
  return (
    <div>
      <Heading>PersonBio {id}</Heading>
      <Container>
        <Typist>
          <SubHeading>
            <Typist.Delay ms={500} /> Name:
          </SubHeading>
        </Typist>

        <Typist>
          <SubHeading>Gender:</SubHeading>
        </Typist>

        <Typist>
          <SubHeading>Mass:</SubHeading>
        </Typist>
        <Typist>
          <SubHeading>Height:</SubHeading>
        </Typist>

        <Typist>
          <SubHeading>Homeworld:</SubHeading>
        </Typist>
      </Container>
    </div>
  );
};

export default PersonBio;
